import React from "react";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import Card from "./Card";
class Home extends React.Component {
  state = {
    cards: [{ id: 1, cardValue: "XB" }, { id: 2, cardValue: "HC" }]
  };
  handle = () => {};
  render() {
    return (
      <div>
        {this.state.cards.map(card => (
          <Card key={card.id} cardValue={card.cardValue} selected={true} />
        ))}
        <Fab size="large" color="link" aria-label="Add" onClick={this.handle}>
          <AddIcon />
        </Fab>
      </div>
    );
  }
}
export default Home;
